## First Example

This is a first example of using Quarto to create a simple document with a ggplot of the mtcars dataset:


::: {.cell}

```{.r .cell-code}
library(ggplot2)

ggplot(mtcars, aes(cyl, fill = factor(cyl))) +
  geom_bar()
```

